
-- Criação ou recriação do banco de dados
DROP DATABASE IF EXISTS `meuprontuario`;
CREATE DATABASE `meuprontuario`;
USE `meuprontuario`;

-- Desabilita verificações de chaves estrangeiras
SET FOREIGN_KEY_CHECKS = 0;

-- Exclusão das tabelas, independentemente de dependências
DROP TABLE IF EXISTS `cid`;
DROP TABLE IF EXISTS `usuario`;
DROP TABLE IF EXISTS `tabelatiss`;
DROP TABLE IF EXISTS `paciente`;
DROP TABLE IF EXISTS `medico`;
DROP TABLE IF EXISTS `hospital`;
DROP TABLE IF EXISTS `historico`;
DROP TABLE IF EXISTS `especialidade`;
DROP TABLE IF EXISTS `endereco`;

-- Reabilita verificações de chaves estrangeiras
SET FOREIGN_KEY_CHECKS = 1;

-- Criação das tabelas
CREATE TABLE `cid` (
  `cod_cid` varchar(10) NOT NULL,
  `descricao` varchar(255) NOT NULL,
  `descricao_abreviada` varchar(50) NOT NULL,
  PRIMARY KEY (`cod_cid`)
);


CREATE TABLE `tabelatiss` (
  `codigo_termo` bigint NOT NULL,
  `descricao` text NOT NULL,
  PRIMARY KEY (`codigo_termo`)
);

CREATE TABLE `endereco` (
  `ID_ENDERECO` int NOT NULL AUTO_INCREMENT,
  `LOGRADOURO` varchar(150) NOT NULL,
  `NUMERO` varchar(10) NOT NULL,
  `BAIRRO` varchar(50) NOT NULL,
  `CIDADE` varchar(50) NOT NULL,
  `ESTADO` varchar(2) NOT NULL,
  `CEP` varchar(8) NOT NULL,
  `CODIGO_MUNICIPIO` int DEFAULT NULL,
  PRIMARY KEY (`ID_ENDERECO`)
);

CREATE TABLE `especialidade` (
  `ID_ESPECIALIDADE` int NOT NULL AUTO_INCREMENT,
  `NOME_ESPECIALIDADE` varchar(100) NOT NULL,
  PRIMARY KEY (`ID_ESPECIALIDADE`)
);

CREATE TABLE `paciente` (
  `ID_PACIENTE` int NOT NULL AUTO_INCREMENT,
  `NOME` varchar(150) NOT NULL,
  `EMAIL` varchar(100) NOT NULL,
  `TELEFONE` varchar(15) NOT NULL,
  `DATA_NASCIMENTO` date NOT NULL,
  `CPF` varchar(11) NOT NULL,
  `ID_ENDERECO` int NOT NULL,
  PRIMARY KEY (`ID_PACIENTE`),
  KEY `ID_ENDERECO` (`ID_ENDERECO`),
  CONSTRAINT `paciente_ibfk_1` FOREIGN KEY (`ID_ENDERECO`) REFERENCES `endereco` (`ID_ENDERECO`) ON DELETE CASCADE
);


CREATE TABLE `hospital` (
  `ID_HOSPITAL` int NOT NULL AUTO_INCREMENT,
  `RAZAO_SOCIAL` varchar(150) NOT NULL,
  `CNPJ` varchar(14) NOT NULL,
  `EMAIL` varchar(100) NOT NULL,
  `TELEFONE` varchar(11) NOT NULL,
  `CATEGORIA` varchar(50) NOT NULL,
  `ID_ENDERECO` int NOT NULL,
  `cnes` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ID_HOSPITAL`),
  KEY `endereco_hospital_fk` (`ID_ENDERECO`),
  CONSTRAINT `endereco_hospital_fk` FOREIGN KEY (`ID_ENDERECO`) REFERENCES `endereco` (`ID_ENDERECO`)
);


CREATE TABLE `medico` (
  `ID_MEDICO` int NOT NULL AUTO_INCREMENT,
  `NOME` varchar(150) NOT NULL,
  `CONSELHO` varchar(50) NOT NULL,
  `ID_HOSPITAL` int NOT NULL,
  `ID_ESPECIALIDADE` int NOT NULL,
  `cbo` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`ID_MEDICO`),
  KEY `ID_HOSPITAL` (`ID_HOSPITAL`),
  KEY `ID_ESPECIALIDADE` (`ID_ESPECIALIDADE`),
  CONSTRAINT `medico_ibfk_1` FOREIGN KEY (`ID_HOSPITAL`) REFERENCES `hospital` (`ID_HOSPITAL`) ON DELETE CASCADE,
  CONSTRAINT `medico_ibfk_2` FOREIGN KEY (`ID_ESPECIALIDADE`) REFERENCES `especialidade` (`ID_ESPECIALIDADE`) ON DELETE CASCADE
);

CREATE TABLE `historico` (
  `id_historico` int NOT NULL AUTO_INCREMENT,
  `data_consulta` date NOT NULL,
  `observacao` text,
  `id_paciente` int NOT NULL,
  `id_hospital` int NOT NULL,
  `id_medico` int NOT NULL,
  `id_especialidade` int NOT NULL,
  `cod_cid` varchar(10) DEFAULT NULL,
  `cod_tiss` bigint DEFAULT NULL,
  PRIMARY KEY (`id_historico`)
);

CREATE TABLE `usuario` (
  `id_usuario` int NOT NULL AUTO_INCREMENT,
  `login` varchar(50) NOT NULL,
  `senha` varchar(50) NOT NULL,
  `tipo` enum('PACIENTE','HOSPITAL') NOT NULL,
  `id_paciente` int DEFAULT NULL,
  `id_hospital` int DEFAULT NULL,
  PRIMARY KEY (`id_usuario`),
  UNIQUE KEY `login` (`login`),
  KEY `id_paciente` (`id_paciente`),
  KEY `id_hospital` (`id_hospital`),
  CONSTRAINT `usuario_ibfk_1` FOREIGN KEY (`id_paciente`) REFERENCES `paciente` (`ID_PACIENTE`),
  CONSTRAINT `usuario_ibfk_2` FOREIGN KEY (`id_hospital`) REFERENCES `hospital` (`ID_HOSPITAL`)
);




































